import React from "react";

const LikedSongs = () => {
  return (
    <div className="likedSongs-page">
      <h1 style={{ color: "white" }}>NO LIKED SONGS</h1>
      <h4 style={{ color: "white" }}>
        Like your first song <i className="fas fa-thumbs-up"></i>
      </h4>
    </div>
  );
};
export default LikedSongs;
